import logo from './logo.svg';
import './App.css';
// import { Button } from '@chakra-ui/react';
import {
  ChakraProvider,
  Box,
  Flex,
  Text,
  Link,
  Heading,
  Container,
  Button
} from '@chakra-ui/react';

function App() {
  return (
    <ChakraProvider>
      <Container maxW="container.xl">
        <Flex direction={["column", "row"]}>
          <Box w={["100%", "20%"]} bg="gray.200" p={4}>
            <Heading size="md">Navigation</Heading>
            <Link href="/about">About Us</Link>
            <Link href="/analytics">Analytics</Link>
            // Add more links as needed
          </Box>
          <Box w={["100%", "80%"]} p={4}>
            <Heading size="lg">Main Content</Heading>
            <Text mb={4}>
              This is the main content area. Place maps, images, and other data here.
            </Text>
            <Button colorScheme="blue">Download PDF</Button>
          </Box>
        </Flex>
      </Container>
    </ChakraProvider>
  );
}

export default App;
